pragma solidity ^0.4.23;
pragma experimental ABIEncoderV2;

import "./SimpleRegistry.sol";
import "../util/TokenReceiver.sol"; 
import "../interfaces/IParameterSource.sol";

/**
@title StakableRegistry interface.
@author Entity Protocol
*/
contract StakableRegistry is SimpleRegistry, TokenReceiver {

    uint256 public minStakeValue;

    struct StakeRecord { 
        uint256 value;
        bool exists;
    }

    mapping(string => StakeRecord) internal itemStakes;

    constructor(address _parametersAddress, uint256 _minStakeValue) public 
        TokenReceiver(IParameterSource(_parametersAddress).getAddress("CORE", "TOKEN")) 
    {
        require(_minStakeValue > 0, "Minimum stake must be non zero."); // TODO: Is this correct?
        minStakeValue = _minStakeValue;
    }

    function getItemStake(string _key) public view 
        returns (uint256 _stakeValue) 
    { 
        return itemStakes[_key].value;
    }

    function getItemWithStake(string _key)
        public
        view
        returns (
            address _owner,
            string _value,
            uint[] _blockHistory,
            uint _timestamp,
            uint256 _stake
        )
    { 
        (_owner, _value, _blockHistory, _timestamp) = super.getItem(_key);
        _stake = getItemStake(_key);
    }

    function getAtIndexWithStake(uint _index)
        public
        view
        returns (
            string _key,
            address _owner,
            string _value,
            uint[] _blockHistory,
            uint _timestamp,
            uint256 _stake
        )
    { 
        (_key, _owner, _value, _blockHistory, _timestamp) = super.getAtIndex(_index);
        _stake = getItemStake(_key);
    }

    /**
    @notice Adds an item to the registry, and locks the staking value from withdraw.
    Will fail if an item of the same key "`_key`" already exists in the registry. 
    Will fail if stake value `_stake` is less than the minimum staking value.
    Will fail if `message.caller.address()` has not deposited stake value `_stake` in this contract.
    @param _key Item key.
    @param _value Item value.
    @param _stake Token stake amount.
    @return _success True if successful, otherwise false.
    */
    function addItem(string _key, string _value, uint256 _stake) public returns (bool _success) { 
        require(_stake >= minStakeValue, "Stake value must be greater than or equal to minimum stake");

        // NOTE: As revert will roll *everything* back, we don't need to check the item 
        // before locking 

        // Require that the caller has enough tokens to be locked, and lock them
        require(_depositHere(_stake), "Tokens must be deposited to this contract.");

        // Require that we can actually add the item
        require(super.addItem(_key, _value), "Base contract must successfully add item.");

        // Add staking record 
        itemStakes[_key].value = _stake;
        itemStakes[_key].exists = true; 

        return true;
    }

   /**
    @notice Deletes an item to the registry, and unlocks the staking value to be avaliable for withdraw.
    Will fail if an item of the  key "`_key`" does not exist.
    Will fail if `message.caller.address()` is not the marked as the owner of the item.
    @param _key Item key to delete.
    @return _success True if successful, otherwise false.
    */
    function deleteItem(string _key) public returns (bool _success) { 
        // Require we have knowledge of this item
        require(itemStakes[_key].exists, "Item must exist for deletion.");

        // Delete the item
        require(super.deleteItem(_key), "Base contract must successfully delete item.");

        // Return the stake back to the sender
        // NOTE: It is still deposited in this contract and will need to be withdrawn
        require(_withdrawTo(msg.sender, itemStakes[_key].value), "Token withdraw must be successful.");

        // Remove the stake entry
        delete itemStakes[_key];

        return true;
    }

    function _transferItem(string _key, address _newOwner, string _newValue, uint256 _newStake) public returns (bool _success) { 

        require(itemStakes[_key].exists, "Item must exist to transfer.");
        require(super._transferItem(_key, _newOwner, _newValue), "Base contract must successfully transfer ownership.");
        itemStakes[_key].value = _newStake;

        return true;
    }
}

